import { useState } from "react";

const Form = () => {

    const [userData, setData] = useState({
        email:'',password:''
    })


    const handleChange = (event) => {
        setData({
            ...userData, [event.target.name]: event.target.value
        })
    }

    return (
        <div>
            <form>
                <label htmlFor="email">Email:</label>
                <input name="email" type="email" placeholder="ingrese su mail" value={userData.email} onChange={handleChange}></input>
                <hr/>
                <label htmlFor="password">Password:</label>
                <input name="password" type="text" placeholder="ingrese una password" value={userData.password} onChange={handleChange}></input>
                <hr/>
                <button>Submit</button>
            </form>
        </div>
    )
}

export default Form
